/*

  Prime Hashtables due to J.A Sory (Number-Theory author). Written in response to the poor quality of existing hashtables, these primality tests
   have much higher bounds, use less memory and most importantly are proven to be correct against all stated inputs.

   Additionally some research has been invested in extending the deterministic bounds up to 2^65. While largely unsuccessful, they have produced
   deterministic tests up to 2^45 and a heuristic base table that successfully eliminates a minimum of 60% of the 2-sprp in the interval
   2^64;2^65.
   This permits the construction of a 3-shot primality test with maximum of 2^-40 failure rate in the interval 2^64;2^65, 
   aka much stronger than random (it would take atleast 10 random tests to achieve the same accuracy). While not deterministic itself, 
   it can be used to strengthen probabilistic tests which are much faster than deterministic variants which require 12-bases in this interval


  When computing the hash it is important to note that all multiplications are done over Z[2^32], also known as wrapping multiplication,
  compilers like gcc and rustc will perform it automatically with high levels of optimization as long as you convert x to a 32-bit unsigned
  integer before the multiplication.

  It is also important to note that unlike other hashtables these are not correct in a standalone check, but rather require trial division 
  and other
  filtering functions to eliminate composites, it's this fusion of tests that let number-theory far surpass other libraries in average
  (and almost surely worst-case {assuming that the assessment of F&J 262K is correct}) complexity.


  Table          Memory (bytes)         Range                 Hash                        Notes
  __________________________________________________________________________________________________________________________________________________

  BASE_32           400                   0;2^32     (x*2849892383)/21474837        Smallest known hashtable in this interval, all
   										    competitors appear to have 512 bytes

  BASE_33           256                2^32;2^33     (x-2^32)/2^24                Attempts at fusing the single-shot tests have all resulted in
                                                                                  much greater memory consumption than the current approach, 
                                                                                  so it is treated as optimal although reducing if-branching is
                                                                                  ideal.
  BASE_34           512                2^33;2^34     (x-2^33)/2^24

  BASE_35           512                2^34;2^35     (x-2^34)/2^25                Highest known bound for a single-shot test, previous tables
  										  limited to 2^32

  BASE_35_64      65536                2^35;2^64     y = x*3301793688/2^17        Due to a fast filtering check for strong pseudoprimes this
  										  test is much smaller than the only other known 2-shot check. 
  										  (Forisek & Jancina's 262K hashtable)


 (Previously there existed a hashtable for 2^64-2^65 that filtered known pseudoprimes, however that is now defunct due to memory consumption and
  development of an equivalently strong check
 )


____________________________________________________________________________________________________________________________________________________



                                 Analysis of other hashtables


       Author               Memory               Bases         Correct                    Critique
___________________________________________________________________________________________________________________________________________________

  Forisek & Jacina       65536                   3             Yes                   Consumes a fair amount of memory for requiring 3-base
  										     checks. Flags 617 as composite due to failure to check if
  										     the base is coprime to inputs.Correct otherwise.
  										     
  Forisek & Jacina       524288			 2 	       No?                  Excessive amounts of memory. Unable to immediately construct
  										    a correct implementation which may be to the fact that the
  										    hashtable is broken.It is not currently known if the failure
  										    is due to Sory's implementation or the specification.

  Bradley Berg           32768                   2-3           No                   Completely broken beyond 2^49. The author claims to have
  										    been unable to verify if the hashtable is correct, which is
  										    puzzling because constructing a hashtable requires a
  										    pseudoprime list that can also be used to verify it.
                                                                                    Unfortunately the author provides zero information on how
                                                                                    they constructed this table, so it seems probable that it
                                                                                    was derived by guesswork. A further note is that the
                                                                                    parameters for a hashtable that Berg was trying to construct
                                                                                    is likely impossible. Tables that small need a filter for
                                                                                    SPRP's, typically an extra base check, or in the case of
                                                                                    this crate a form check. 

  J.A Sory            66816                   1-2            Yes                    Only a single test between 0;2^35 and two tests between
                                                                                    2^35;2^64.

                                                                                    Passes every single test applied including enumeration up to 
                                                                                    2^40.

*/
